window.bookSummaryJSON = "<p>My life was normal.</p> <p></p> <p>Just my mom and I, living in a small town on the East Coast.</p> <p></p> <p>The eve of my twenty first birthday, it all changed. A father I have never known returned and took me away from all I knew.</p> <p></p> <p>Trapped and tortured. Destined for something I knew nothing about.</p> <p></p> <p>Little did I know, my entire life, I’d been haunted by the devil himself.</p> <p></p> <p>He was always watching and waiting.</p> <p></p> <p>As leader of an infamous cult in our area, this is no longer a haunting.</p> <p></p> <p>He is here.</p> <p></p> <p>And I’m terrified.</p> <p></p> <p>*This is a very dark forbidden horror romance. Does end with a HEA</p>"; 
